import React from 'react'
import { Link } from 'react-router-dom'
import defaultImg from '../assets/images/room-1.jpeg'

export default function ListingCard(house) {

    const houseInfo = house.fields;
    const { title, capacity,type, images, price, city, state, zip
    } = houseInfo;

    return (

        <div className="listing-card-container">
            {/* Listing Card Image */}
            <div className="listing-card-image-container">
                 <img src={images[0].fields.file.url || defaultImg} alt="house listing"></img> 
            </div>

             {/* Listing Card Content */}
            <div className="listing-card-content-container">
                {/*  <Link to={`/listing/${house.sys.id}`} className='house-title'> 
                <Link to="/home" className="house-card-title"> {title} </Link> */}
                <Link to={`/housedetails/${house.sys.id}`} className="house-card-title"> {title} </Link>
                <div className="house-card-detail">
                    <p>Type: {`${type}`}</p>
                    <p>Capacity: {capacity}</p>
                    <p>{`${city} • ${state} • ${zip}`}</p>
                    <p><span className="price-tag">{`$${price}`}</span> / month
                    </p>
                </div>

            </div>

        </div>
    )
}
